import React from "react";

import { BrowserRouter, Switch, Route} from "react-router-dom";

import Main from "./pages/main";
import Genres from "./pages/genres";

const Routes = () => {
    <BrowserRouter>
        <Switch>
            <Route exact path="/" component={Main} />
        </Switch>
    </BrowserRouter>
};

export default Routes;
